import React from 'react';

function Food({ name }) {
  return (
    <h1>I like {name}</h1>
  );
}

const foorILike = ['kim', 'park', 'choe'];

function App() {
  return (
    <div>
      {foorILike.map(dish => (
        <Food name={dish} />
      ))}
    </div>
  );
}

export default App;
